INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES ("ペコリーヌとの出会い", 0, 5118061, 1, 91002, "青空の下で謁見", 40, 7, 10118, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 8, 2834, "フリーマーケット会場", 2, 0);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES ("マホとの出会い", 0, 5118062, 1, 91002, "未来の騎空団\nマスコット？", 40, 7, 10118, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 8, 2835, "フリーマーケット会場", 2, 0);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES ("アキノとの出会い", 0, 5118063, 1, 91002, "お嬢さまからの\n緊急依頼", 40, 7, 10118, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 8, 2837, "ランドソル市街地", 2, 0);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES ("ジュンとの出会い", 0, 5118064, 1, 91002, "黄金色の悩みごと", 40, 18, 10118, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 8, 4108402, "フリーマーケット会場", 2, 0);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES ("カオリとの出会い", 0, 5118065, 1, 91002, "白熱！　格闘大会！", 40, 18, 10118, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 8, 4107402, "フリーマーケット会場", 2, 0);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES ("ニノンとの出会い", 0, 5118066, 1, 91002, "祭り太鼓はオーエドの華", 40, 16, 10118, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 8, 9000227, "オーエド町", 2, 1);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES ("スズナとの出会い", 0, 5118067, 1, 91002, "人気者は遅れて\nやってくる", 40, 19, 10118, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 8, 2101181, "フリーマーケット会場", 3, 0);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES ("ナナカとの出会い", 0, 5118068, 1, 91002, "巫女・ミーツ・魔法少女", 40, 18, 10118, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 8, 4109402, "ランドソル市街地", 3, 0);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES ("キャル＆コッコロとの出会い", 0, 5118069, 1, 91002, "ネズ耳は二度なくなる", 40, 18, 10118, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 8, 4305402, "フリーマーケット会場", 3, 0);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES ("ユカリとの出会い", 0, 5118070, 1, 91002, "この出会いにカンパイ！", 40, 18, 10118, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 8, 4101402, "ランドソル市街地", 3, 0);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES ("アオイとの出会い", 0, 5118071, 1, 91002, "陰陽アンサンブル", 40, 18, 10118, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 8, 4106402, "ランドソル市街地", 3, 0);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES ("シノブとの出会い", 0, 5118072, 1, 91002, "運試し十番勝負！", 40, 7, 10118, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 8, 2836, "フリーマーケット会場", 3, 1);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES ("オープニング", 10145115, 5118600, 0, 0, "彼女たちの新たな日常", 0, 0, 10118, 0, 0, 0, 0, 1, 0);
